import './App.css';
import styled from 'styled-components';
import { AccountBox } from './components/accountBox';

const AppContainer = styled.div`
  width: 100%;
  height: 100%;
  display: top;
  flex-direction: column;
  align-items: left;
  justify-content: center;
`;

function App() {
  return (
    <AppContainer>
      <AccountBox />
    </AppContainer>
  );
}

export default App;
